import React from 'react';
import './Avatar.css';
import PropTypes from 'prop-types';

const Avatar = ({url}) => {
  return (
    // <div className="Avatar">
      <img className="imageBorder" src={url} alt="Neopet Avatar"/>
  );
}

Avatar.propTypes = {
  url: PropTypes.string
};

export default Avatar;
